import styled from 'styled-components';

export const NavContainer = styled.nav`
  display: flex;
  align-items: top;
  justify-content: space-between;
  padding: 0;

  ul {
    display: flex;
    gap: 1rem;
    list-style-type: none;
  }

  .logo-container {
    display: flex;

  }
`;
